import React from "react";
import { useState } from "react";
import {
  Typography,
  TextField,
  Button,
  Stepper,
  Step,
  StepLabel,
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import {
  Modal,

  Form,
  Col,
  Row,
  Container,
  FormGroup,
} from "react-bootstrap";
import Card from 'react-bootstrap/Card';
// import Table from "react-bootstrap/Table";


// const [emp, setEmp] = useState({
//   profilepic: "",
//   firstname: "",
//   lastname: "",
//   dob: "",
//   cnic: "",
//   gender: "",
//   martialStatus: "",
//   religion: "",
//   jobtitle: "",
//   username: "",
//   primaryemail: "",
//   secondaryemail: "",
//   password: "",
//   primaryphone: "",
//   secondaryphone: "",
//   permanentaddress: "",
//   temporaryaddress: "",
//   province: "",
//   city: "",
//   postalCode: "",
//   departments: "",
//   designation: "",
//   joiningdate: "",
//   educationdetails: "",
//   employementhistory: "",

//   currentSalary: "",
//   employementstatus: "",
//   //bank information
//   bankname: "",
//   paymentmode: "",
//   accounttitle: "",
//   accountno: "",
//   IBAN: "",
//   branchcode: "",
//   country:"",
  //degree info
// });


// const [testUpdate, setTestUpdate] = useState(false);
// const [employement, setemployement] = useState([]);

// const removemployement = (i) =>{
//   const temp = employement;
//   employement.splice(i,1); 
//   console.log("splice",temp)
  // setemployement(temp);
  // setTestUpdate(!testUpdate)
// }


// const [empdetails, setempdetails] = useState({
//   company: "",
//   position: "",
//   joiningdate: "",
//   resignationdate: "",
//   duration: "",
//   jobdescription: "",
// });

// const addhistory = () => {
//   var empl = employement;
//   empl.push({
//     company: empdetails.company,
//     position: empdetails.position,
//     joiningdate: empdetails.joiningdate,
//     resignationdate: empdetails.resignationdate,
//     duration: empdetails.duration,
//     jobdescription: empdetails.jobdescription,
//   });
//   console.log("emplllllllll", empl);
//   setemployement(empl);
//   setEmp({ ...emp, employementhistory: empl });
// };

const useStyles = makeStyles((theme) => ({
  button: {
    marginRight: theme.spacing(1),
  },
}));

function getSteps() {
  return [
    "Personal Information",
    "Address & Region",
    "Education Information",
    "Previous Information",
    "Employement Details",
    "Bank Details"
  ];
}

function getStepContent({props2,activeStep}) {
  const props =props2
  const step =activeStep
  const [childModel1, setShowChildModel1] = useState(false);
  const [childModel, setShowChildModel] = useState(false);
  const Closechildmodal = () => setShowChildModel(false);
  const Closechildmodal1 = () => setShowChildModel1(false);


 

  switch (step) {
    case 0:
      return (
        <>
          
          <div className="w-75" id="responsivewidth" style={{width:'60%', height:'40%'}}>
                  <Col>
                    <Row >
                      <Col xxl="6" xl="6" lg="6" md="6">
                        <Form.Group
                          as={Col}
                          controlId="formGridFirstName"
                          className="formmargin"
                        >
                          <Form.Label>First Name</Form.Label>
                          <Form.Control
                            type="text"
                            required
                            name="firstname"
                            placeholder="First Name"
                            // value={emp.firstname}
                            value={props.value}
                            // onChange={handleinput}
                            onChange={props.onChange}
                          />
                        </Form.Group>
                      </Col>
                      <Col xxl="6" xl="6" lg="6" md="6">
                        <Form.Group
                          as={Col}
                          controlId="formGridLastName"
                          className="formmargin"
                        >
                          <Form.Label>Last Name</Form.Label>
                          <Form.Control
                            type="text"
                            required
                            name="lastname"
                            placeholder="Last Name"
                            // value={emp.lastname}
                            value={props.value1}
                            // onChange={handleinput}
                            onChange={props.onChange}
                          />
                        </Form.Group>
                      </Col>
                    </Row>
                    <Row>
                      <Col xxl='6' xl='6' lg='6' md='6'>
                        <Form.Group
                          as={Col}
                          controlId="formGridgender"
                          className="formmargin"
                        >
                          <Form.Label>Gender</Form.Label>
                          <Form.Select
                            required
                            name="gender"
                            // value={emp.gender}
                            value={props.value2}
                            // onChange={handleinput}
                            onChange={props.onChange}
                          >
                            <option value="" selected hidden disabled>
                              Please Select
                            </option>
                            <option>Male</option>
                            <option>Female</option>
                            <option>Other</option>
                          </Form.Select>
                        </Form.Group>
                      </Col>
                      <Col xl='6' lg="6" md="6">
                        <Form.Group
                          as={Col}
                          controlId="formGridFirstName"
                          className="formmargin"
                        >
                          <Form.Label>National ID </Form.Label>
                          <Form.Control
                            type="number"
                            required
                            name="cnic"
                            placeholder="CNIC"
                            // value={emp.cnic}
                            value={props.value3}
                            // onChange={handleinput}
                            onChange={props.onChange}
                            //   disabled={disableFields}
                          />
                        </Form.Group>
                      </Col>
                    </Row>
                    <Row>
                      <Col xxl='6' xl='6' lg='6'>
                        <Form.Group
                          as={Col}
                          controlId="formGridLastName"
                          className="formmargin"
                        >
                          <Form.Label>D-0-B</Form.Label>
                          {/* <DatePicker
                            required
                            selected={emp.dob}
                            onChange={(date)=>{setEmp({...emp,dob:moment(date).format('dd/mm/yyyy')})}}
                            // dateFormat='d MMMM, yyyy'
                            dateFormat='dd/mm/yyyy'
                            dropDownMode="select"
                          /> */}
                          <Form.Control
                            type="date"
                            required
                            placeholder="dd/mm/yyyy"
                            name="dob"
                            // value={emp.dob}
                            value={props.value4}
                            // onChange={handleinput}
                            onChange={props.onChange}
                            //   disabled={disableFields}
                          />
                        </Form.Group>
                      </Col>

                      <Col  xl='6' lg="6" >
                        <Form.Group
                          as={Col}
                          controlId="formGridMartialStatus"
                          className="formmargin"
                        >
                          <Form.Label>Martial Status</Form.Label>
                          <Form.Select
                            required
                            name="martialStatus"
                            placeholder="martial status.."
                            // value={emp.martialStatus}
                            value={props.value5}
                            // onChange={handleinput}
                            onChange={props.onChange}
                            //   disabled={disableFields}
                          >
                            <option value="" selected hidden disabled>
                              Please Select
                            </option>
                            <option>Single</option>
                            <option>Married</option>
                            <option>Divorced</option>
                            <option>widow</option>
                          </Form.Select>
                        </Form.Group>
                      </Col>
                      <Col xl='6' lg='6'>
                        <Form.Group
                          as={Col}
                          controlId="formGridLastName"
                          className="formmargin"
                        >
                          <Form.Label>Religion</Form.Label>
                          <Form.Select
                            required
                            name="religion"
                            placeholder="Religion"
                            // value={emp.religion}
                            value={props.value6}
                            // onChange={handleinput}
                            onChange={props.onChange}
                            //   disabled={disableFields}
                          >
                            <option value="" selected hidden disabled>
                              Please Select
                            </option>
                            <option>Islam</option>
                            <option>Christianity</option>
                            <option>Buddhism</option>
                            <option> Sikhism</option>
                            <option> Hinduism</option>
                            <option>Bahá’í</option>
                            <option>Confucianism</option>
                            <option>Jainism</option>
                            <option>Judaism</option>
                            <option>Zoroastrianism</option>
                            <option>Druze</option>
                          </Form.Select>
                        </Form.Group>
                      </Col>
                    </Row>
                  </Col>
                  
                  
                  </div>
                  
        </>
      );

    case 1:
      return (
        <>
         
            <div>
          <Row>
                    <h5
                      className="py-2 "
                      style={{ fontSize: "22px", padding: "0px 19px" }}
                    >
                      Primary
                    </h5>
           <Col xxl="6" xl="6" lg="6" md="6">
                      <Form.Group
                        as={Col}
                        controlId="formGridphone"
                        className="formmargin "
                      >
                        <Form.Label>Phone</Form.Label>
                        <Form.Control
                          type="number"
                          required
                          name="primaryphone"
                          placeholder="phone"
                          // value={emp.primaryphone}
                          value={props.value8}
                          // onChange={handleinput}
                          onChange={props.onChange}
                        />
                      </Form.Group>
                    </Col>
                    <Col xxl="6" xl="6" lg="6" md="6">
                      <Form.Group
                        as={Col}
                        controlId="formGridcompanyemail"
                        className="formmargin "
                      >
                        <Form.Label>Email</Form.Label>
                        <Form.Control
                          type="email"
                          required
                          name="primaryemail"
                          placeholder="email"
                          // value={emp.primaryemail}
                          value={props.value9}
                          // onChange={handleinput}
                          onChange={props.onChange}
                        />
                      </Form.Group>
                    </Col>
                  </Row>

                  <Row>
                    <h5
                      className="py-2 "
                      style={{ fontSize: "22px", padding: "0px 19px" }}
                    >
                      Secondary
                    </h5>
                    <Col xxl="6" xl="6" lg="6" md="6">
                      <Form.Group
                        as={Col}
                        controlId="formGridcompanyemail"
                        className="formmargin "
                      >
                        <Form.Label>Phone</Form.Label>
                        <Form.Control
                          type="number"
                          required
                          name="secondaryphone"
                          placeholder="secondary phone"
                          // value={emp.secondaryphone}
                          value={props.value10}
                          // onChange={handleinput}
                          onChange={props.onChange}
                        />
                      </Form.Group>
                    </Col>
                    <Col xxl="6" xl="6" lg="6" md="6">
                      <Form.Group
                        as={Col}
                        controlId="formGridcompanyemail"
                        className="formmargin "
                      >
                        <Form.Label>Email</Form.Label>
                        <Form.Control
                          type="email"
                          required
                          name="secondaryemail"
                          placeholder="secondary Email"
                          // value={emp.secondaryemail}
                          value={props.value11}
                          // onChange={handleinput}
                          onChange={props.onChange}
                        />
                      </Form.Group>
                    </Col>
                    </Row>
                    </div>
        </>
      );
    case 2:
      return (
        <>
         <div>
            <Col lg={12}>
                  <Form.Group
                    as={Col}
                    controlId="formGridFirstName"
                    className="formmargin"
                  >
                    <Form.Label>Temporary Address</Form.Label>
                    <Form.Control
                      type="text"
                      required
                      name="temporaryaddress"
                      placeholder="complete address"
